// EXTRAER Y PREPARAR SESIÓN DESDE WEBHOOK
const inputData = $input.first().json;
const { message, sessionId: inputSessionId, attachments } = inputData;

// Generar sessionId si no viene del chat web
const sessionId = inputSessionId || 'session-' + Date.now() + '-' + Math.random().toString(36).substr(2, 9);

console.log('Webhook recibido:', { message, sessionId, attachments });
console.log('SessionId generado/usado:', sessionId);

// Preparar datos para el flujo LangChain con sessionId explícito
const messageData = {
  text: message,
  sessionId: sessionId,  // CRÍTICO: sessionId para memoria
  userInput: message,
  timestamp: new Date().toISOString(),
  attachments: attachments || []
};

// Devolver solo el JSON con el sessionId correcto
return {
  json: messageData
};
